import React from "react";
import { Container,Card } from "react-bootstrap";
import './TaskDetails.css'

const TaskDetails=(props)=>{
    return(
        <li>
            <Container className="task-item-container">
               <Card className="task-card">
                   <Card.Body>{props.startDate}</Card.Body>
                </Card>
                <div className="task-description">{props.task}</div>
                <Card className="task-card">
                   <Card.Body>{props.endDate}</Card.Body>
                </Card>
                <button className="completed-button">Completed</button>
            </Container>
        </li>
    )
}

export default TaskDetails
